(window.webpackJsonp=window.webpackJsonp||[]).push([[19],{431:function(e,o){e.exports={frontMatter:{slug:"yilancorp",fileName:"yilancorp",readingTime:"☕️ 1 minuto de lectura",wordCount:164,date:"10-01-2017",formattedDate:"Enero 2017",imageUrl:"//res.cloudinary.com/wochap/image/upload/v1495070101/works/yilancorp.png",heroImageUrl:"//res.cloudinary.com/wochap/image/upload/v1495070203/wochap/hero/yilancorp.jpg",title:"Yilancorp",tasks:"Desarrollo de landing page.",role:"Front-end developer",siteLink:"http://yilancorp.com/",description:"Yilancorp es una empresa que ofrece productos y servicios: inpeccion de mercaderías, contizaciones y verificacion de fabricas.",tags:["Front-end","Jquery","SASS","Webpack","Freelance"]},bodyHtml:'<h2 id=resumen>Resumen</h2><p>Gracias a la experiencia con anteriores proyectos, fue facil desarrollar el sitio, haciendo uso de mi framework personal <a href=https://github.com/wocss rel=nofollow target=_blank>wocss</a> (inspirado en <a href=https://github.com/inuitcss rel=nofollow target=_blank>InuitCSS</a>) y <a href=https://jquery.com/ rel=nofollow target=_blank>Jquery</a>, para las animaciones use <a href=http://velocityjs.org/ rel=nofollow target=_blank>VelocityJS</a>, tambien hize uso de <a href=http://materializecss.com/scrollspy.html rel=nofollow target=_blank>Scrollspy</a> (modulo de <a href=http://materializecss.com/ rel=nofollow target=_blank>MaterializeCSS</a>), tuve que modificarlo para que funcionara con un diferente <code>scroll container</code>.<h2 id=tecnologías-destacadas>Tecnologías destacadas:</h2><ul><li><a href=https://developer.mozilla.org/en-US/docs/Web/API/Service_Worker_API rel=nofollow target=_blank>Service worker</a><li><a href=https://developer.mozilla.org/es/docs/Web/CSS/CSS_Animations/Usando_animaciones_CSS rel=nofollow target=_blank>CSS Animations</a><li><a href=https://es.wikipedia.org/wiki/JSONP rel=nofollow target=_blank>JSONP</a></ul><div class=c-markdown-image-full><img alt="JSONP demo"src=//res.cloudinary.com/wochap/image/upload/v1495070174/wochap/body/yilancorp-services.gif></div><ul><li><a href=https://css-tricks.com/snippets/css/a-guide-to-flexbox/ rel=nofollow target=_blank>CSS FlexBox</a></ul><h2 id=workflow>Workflow:</h2><ul><li><strong>CSS:</strong> <a href=http://stylus-lang.com/ rel=nofollow target=_blank>SASS</a>, <a href=http://csswizardry.com/2015/08/bemit-taking-the-bem-naming-convention-a-step-further/ rel=nofollow target=_blank>BEMIT</a>, <a href=http://csswizardry.net/talks/2014/11/itcss-dafed.pdf rel=nofollow target=_blank>ITCSS</a>, <a href=https://github.com/wocss rel=nofollow target=_blank>WOCSS</a>.<li><strong>JS:</strong> <a href=https://jquery.com/ rel=nofollow target=_blank>Jquery</a>, <a href=https://babeljs.io/learn-es2015/ rel=nofollow target=_blank>ES2015</a>, <a href=http://eslint.org/ rel=nofollow target=_blank>ESLint</a>.<li><strong>Build System:</strong> <a href=https://webpack.github.io/ rel=nofollow target=_blank>Webpack</a> + <a href=https://babeljs.io/ rel=nofollow target=_blank>Babel</a> + <a href=https://github.com/wochap/wochap.github.io/tree/dev/build/webpack/loaders rel=nofollow target=_blank>custom-loaders</a>.</ul><h2 id=logros>Logros:</h2><ul><li>Personalizar el plugin <a href=http://materializecss.com/scrollspy.html rel=nofollow target=_blank>Scrollspy</a> de <a href=http://materializecss.com/ rel=nofollow target=_blank>MaterializeCSS</a>, para que funcionase con un diferente <code>scroll container</code>.<li><code>Fancy animations</code>.</ul>'}}}]);
